-- ----------------------------
-- Table structure for bridge_config
-- ----------------------------
DROP TABLE IF EXISTS `bridge_config`;
CREATE TABLE `bridge_config` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `source_chainId` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `target_chainId` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `source_coin_address` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `fee_fixed` double NOT NULL COMMENT '固定金额手续费，',
  `fee_percent` double NOT NULL COMMENT '手续费百分比，如果不需要则设置为0',
  `day_total` decimal(20,10) NOT NULL COMMENT '单用户每日跨链不需要审核的总额度',
  `once_total` decimal(20,10) NOT NULL COMMENT '单用户每次跨链不需要审核的额度',
  `isEnable` tinyint(1) NOT NULL,
  `target_coin_address` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `update_at` datetime DEFAULT NULL,
  `create_at` datetime DEFAULT NULL,
  `isDelete` tinyint(1) NOT NULL DEFAULT '0',
  `tron_trc20_have_no_fee` double DEFAULT '0' COMMENT '波场如果没有TRC20时收取的固定惩罚费用',
  `tron_not_active_fee` double DEFAULT '0' COMMENT '波场收款方未激活时收取的固定惩罚费用',
  PRIMARY KEY (`id`),
  UNIQUE KEY `bridge_config_unique` (`source_chainId`,`target_chainId`,`source_coin_address`,`target_coin_address`),
  KEY `BridgeConfig_fromChainId_IDX` (`source_chainId`,`target_chainId`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=58 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='可跨币种设置';

