  UNIQUE KEY `bridge_order_unique` (`orderId`),
  KEY `bridge_order_orderId_IDX` (`orderId`) USING BTREE,
  KEY `bridge_order_source_address_IDX` (`source_address`,`target_address`) USING BTREE,
  KEY `bridge_order_source_chainId_IDX` (`source_chainId`,`target_chainId`) USING BTREE,
  KEY `bridge_order_source_coin_address_IDX` (`source_coin_address`,`target_coin_address`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=172 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

